const newSamples = [];
for (var i = 1; i <= 25; i++) {
target_material = constants[Math.floor(Math.random() * Object.keys(constants).length)];
target_thickness = Math.random() * (constants[target_material]['target_thickness'] - 0.1) + 0.1;
pulse_width = Math.floor(Math.random() * (constants[target_material]['pulse_width'] - 250) + 250);
energy = Math.floor(Math.random() * (constants[target_material]['energy'] - 1) + 1);
spot_size = Math.floor(Math.random() * (constants[target_material]['spot_size'] - 1) + 1);
intensity = constants[target_material]['intensity'] * (1 + (Math.random() * 0.5));
power = constants[target_material]['power'] * (1 + (Math.random() * 0.5));
cutoff_energy = constants[target_material]['cutoff_energy'];
newSamples.push({
'target_material': target_material,
'target_thickness': target_thickness,
'pulse_width': pulse_width,
'energy': energy,
'spot_size': spot_size,
'intensity': intensity,
'power': power,
'cutoff_energy': cutoff_energy
});
}

